import React, { Component } from 'react';
import logo from './img/log.jpg';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { NavItem, NavLink } from 'reactstrap';
import { Nav, NavDropdown, Form, FormControl, Button, Navbar} from 'react-bootstrap';

class Header extends Component {
  render() {
    return (
<Navbar bg="light" expand="lg">
  <NavItem className="d-flex align-items-left">
    <NavLink className="font-weight-bold" tag={Link} to="/">
      <img src={logo} alt="fs" className="img-fluid rounded-circle" style={{ width: 36 }} />
      <Navbar.Brand href="/">FoodShare</Navbar.Brand>
    </NavLink>
  </NavItem>
  <Navbar.Brand href="/">FoodShare</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="/">Home</Nav.Link>
      <Nav.Link href="/posts">Explore</Nav.Link>
      <Nav.Link href="/donation">Donate</Nav.Link>
      <Nav.Link href="/about">About</Nav.Link>
      <Nav.Link href="/register">Sign Up</Nav.Link>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-success">Search</Button>
    </Form>
  </Navbar.Collapse>
</Navbar>
    )
  }
}
export default Header;
